import React from "react";
import './Login.css';

function Login(){
    return (
        <>
          <h1 className="login"> Welcome to MedApp</h1>
          <div className="container form_align">
              <h4 className="form_head">Sign in to special offer, health tips and more</h4>
              <form>
                    <div className="form-group col-sm-offset-4 col-sm-4">
                      <input type="email" className="form-control" id="email" placeholder="Enter email" name="email" />
                    </div>
                    <div className="form-group col-4 col-sm-4">
                      <input type="password" className="form-control" id="pwd" placeholder="Enter password" name="pwd" />
                    </div>
                    <button type="submit" className="btn btn-default btn_login">Sign In</button>
                </form>
            </div>
        </>
    );
}

export default Login;
